class App extends Component {
  render() {
      const value = 2;
    return (
        <div>
            {
                (function() {
                    if(value === 1)
                        return (<div>하나</div>)
                    if(value === 2)
                        return (<div>둘</div>)
                    if(value ===3)
                        return (<div>셋</div>)
                })
            }
        </div>
    );
  }
}

export default App;
